/**
 * Generates a random number between 0 and PI.
 *
 * @return the cutoff angle.
 */
private double randomCutoffAngle() {
  while(true) {
    double radius = randomDouble();
    if (radius <0 || radius > Math.PI){
      continue;
    }
    return radius;
  }
}

/**
 * Generates a random number between 0 and PI.
 *
 * @return the cutoff angle.
 */
private double randomCutoffAngle() {
  return randomDouble() * Math.PI;
}

